// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./Splitter.sol";

contract SplitFactory {
    address[] public allSplitters;
    mapping(address => address[]) public userSplitters;

    event SplitterCreated(
        address indexed creator,
        address splitterAddress,
        string name,
        address token,
        address[] members,
        uint256[] shares
    );

    function createSplitter(
        string memory name,
        address token,
        address[] memory members,
        uint256[] memory shares,
        bool autoDistribute
    ) external returns (address) {
        require(token != address(0), "Invalid token");
        require(members.length == shares.length, "Length mismatch");
        require(members.length > 0, "No members");

        uint256 totalShares;
        for (uint256 i = 0; i < shares.length; i++) {
            require(members[i] != address(0), "Zero member");
            require(shares[i] > 0, "Zero share");
            totalShares += shares[i];

            // duplicate member check
            for (uint256 j = i + 1; j < members.length; j++) {
                require(members[i] != members[j], "Duplicate member");
            }
        }
        require(totalShares > 0, "Invalid shares");

        Splitter splitter = new Splitter(
            msg.sender,
            name,
            token,
            members,
            shares,
            autoDistribute
        );

        address splitterAddress = address(splitter);
        allSplitters.push(splitterAddress);
        userSplitters[msg.sender].push(splitterAddress);

        emit SplitterCreated(
            msg.sender,
            splitterAddress,
            name,
            token,
            members,
            shares
        );

        return splitterAddress;
    }

    function getUserSplitters(address user)
        external
        view
        returns (address[] memory)
    {
        return userSplitters[user];
    }

    function getAllSplitters() external view returns (address[] memory) {
        return allSplitters;
    }
}

contracts/Splitter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

interface IERC20 {
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract Splitter {
    address public owner;
    string public name;
    address public token;
    address[] public members;
    uint256[] public shares;
    uint256 public totalShares;
    bool public autoDistribute;

    struct Payment {
        uint256 amount;
        address payer;
        uint256 timestamp;
        bool distributed;
    }

    Payment[] public paymentHistory;

    event PaymentReceived(address indexed payer, uint256 amount, uint256 timestamp);
    event DistributionCompleted(address indexed member, uint256 amount, uint256 timestamp);
    event SharesUpdated(address[] newMembers, uint256[] newShares, uint256 timestamp);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    constructor(
        address _owner,
        string memory _name,
        address _token,
        address[] memory _members,
        uint256[] memory _shares,
        bool _autoDistribute
    ) {
        require(_members.length == _shares.length, "Length mismatch");
        require(_members.length > 0, "No members");

        owner = _owner;
        name = _name;
        token = _token;
        members = _members;
        shares = _shares;
        autoDistribute = _autoDistribute;

        for (uint256 i = 0; i < _shares.length; i++) {
            totalShares += _shares[i];
        }
        require(totalShares > 0, "Invalid shares");
    }

    function receivePayment(uint256 amount) external {
        require(amount > 0, "Invalid amount");

        require(
            IERC20(token).transferFrom(msg.sender, address(this), amount),
            "Transfer failed"
        );

        paymentHistory.push(
            Payment({
                amount: amount,
                payer: msg.sender,
                timestamp: block.timestamp,
                distributed: false
            })
        );

        emit PaymentReceived(msg.sender, amount, block.timestamp);

        if (autoDistribute) {
            _distribute();
        }
    }

    function distribute() external onlyOwner {
        _distribute();
    }

    function _distribute() internal {
        uint256 balance = IERC20(token).balanceOf(address(this));
        require(balance > 0, "No balance");

        for (uint256 i = 0; i < members.length; i++) {
            uint256 payout = (balance * shares[i]) / totalShares;
            if (payout > 0) {
                require(IERC20(token).transfer(members[i], payout), "Transfer failed");
                emit DistributionCompleted(members[i], payout, block.timestamp);
            }
        }

        paymentHistory[paymentHistory.length - 1].distributed = true;
    }

    function updateShares(address[] memory newMembers, uint256[] memory newShares)
        external
        onlyOwner
    {
        require(newMembers.length == newShares.length, "Length mismatch");
        require(newMembers.length > 0, "No members");

        delete members;
        delete shares;

        uint256 newTotal;
        for (uint256 i = 0; i < newShares.length; i++) {
            newTotal += newShares[i];
        }
        require(newTotal > 0, "Invalid shares");

        members = newMembers;
        shares = newShares;
        totalShares = newTotal;

        emit SharesUpdated(newMembers, newShares, block.timestamp);
    }

    function getMembers() external view returns (address[] memory, uint256[] memory) {
        return (members, shares);
    }

    function getPaymentHistory() external view returns (Payment[] memory) {
        return paymentHistory;
    }

    function getContractBalance() external view returns (uint256) {
        return IERC20(token).balanceOf(address(this));
    }
}

contracts/Treasury.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

interface IERC20 {
    function transfer(address recipient, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract Treasury {
    address public owner;
    mapping(address => bool) public authorized;

    struct ScheduledPayment {
        address splitter;
        uint256 amount;
        uint256 scheduleTime;
        bool executed;
    }

    ScheduledPayment[] public scheduledPayments;

    event ScheduledPaymentCreated(uint256 indexed id, address splitter, uint256 amount, uint256 scheduleTime);
    event PaymentExecuted(uint256 indexed id, address splitter, uint256 amount);

    modifier onlyOwnerOrAuthorized() {
        require(msg.sender == owner || authorized[msg.sender], "Not authorized");
        _;
    }

    constructor() {
        owner = msg.sender;
        authorized[msg.sender] = true;
    }

    function schedulePayment(
        address splitter,
        uint256 amount,
        uint256 scheduleTime
    ) external onlyOwnerOrAuthorized returns (uint256) {
        require(scheduleTime > block.timestamp, "Schedule time must be future");

        uint256 id = scheduledPayments.length;
        scheduledPayments.push(
            ScheduledPayment({
                splitter: splitter,
                amount: amount,
                scheduleTime: scheduleTime,
                executed: false
            })
        );

        emit ScheduledPaymentCreated(id, splitter, amount, scheduleTime);
        return id;
    }

    function executeScheduledPayment(uint256 id) external onlyOwnerOrAuthorized {
        _executeScheduledPayment(id);
    }

    function _executeScheduledPayment(uint256 id) internal {
        require(id < scheduledPayments.length, "Invalid ID");
        ScheduledPayment storage payment = scheduledPayments[id];

        require(!payment.executed, "Already executed");
        require(block.timestamp >= payment.scheduleTime, "Too early");

        (bool success, ) = payment.splitter.call(
            abi.encodeWithSignature("receivePayment(uint256)", payment.amount)
        );
        require(success, "Execution failed");

        payment.executed = true;
        emit PaymentExecuted(id, payment.splitter, payment.amount);
    }

    function batchExecutePayments(uint256[] calldata ids)
        external
        onlyOwnerOrAuthorized
    {
        for (uint256 i = 0; i < ids.length; i++) {
            if (
                ids[i] < scheduledPayments.length &&
                !scheduledPayments[ids[i]].executed &&
                block.timestamp >= scheduledPayments[ids[i]].scheduleTime
            ) {
                _executeScheduledPayment(ids[i]);
            }
        }
    }

    function authorize(address account) external onlyOwnerOrAuthorized {
        authorized[account] = true;
    }

    function revokeAuthorization(address account) external onlyOwnerOrAuthorized {
        authorized[account] = false;
    }

    function getScheduledPayments()
        external
        view
        returns (ScheduledPayment[] memory)
    {
        return scheduledPayments;
    }
}

